import React from 'react';
import ReactDOM from 'react-dom/client';
import App  from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
const abc = ReactDOM.createRoot(document.getElementById('abc'));
root.render(
  <React.StrictMode>
    <App />
    <App />
  </React.StrictMode>
);

abc.render(
  <React.StrictMode>
    <App />
    <App />
  </React.StrictMode>
);
